import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { SafeAreaProvider } from 'react-native-safe-area-context';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { ThemeProvider } from 'react-native-elements';
import { Container } from './src/styles/Global.js';

import Home from './src/views/Home/Home';
import Shooting from './src/views/Shooting/Shooting';
import Result from './src/views/Result/Result';

const Stack = createStackNavigator();

export default function App() {
  return (
    <SafeAreaProvider>
      <ThemeProvider>
        <NavigationContainer>
          <Stack.Navigator style={Container}>
            <Stack.Screen name="Home" component={Home} />
            <Stack.Screen name="Result" component={Result} />
            <Stack.Screen name="Shooting" component={Shooting} />
          </Stack.Navigator>
          <StatusBar />
        </NavigationContainer>
      </ThemeProvider>
    </SafeAreaProvider>
  );
}
